import React from 'react';

const Logs = () => {
  return (
    <ul className='collection with-header'>
      <li className='collection-header center'>
        <h4>Logs</h4>
      </li>
      <li className='collection-item'>
        <div>
          <a href='#edit-log-modal'>Clickable title to edit the log as modal</a>
          <i class='material-icons'>send</i>
          <br />
          <span>
            2 Kilo - Launderer: Jane Doe, updated by Admin July 01, 2020
          </span>
        </div>
      </li>
      {/* <li class='collection-item'>Alvin</li>
      <li class='collection-item'>Alvin</li>
      <li class='collection-item'>Alvin</li> */}
    </ul>
  );
};

export default Logs;
